text:
@RedTav71 Difendere il diritto di chiunque di candidarsi, indipendentemente dal reddito, professione, titolo di studio, età, sesso, religione, non è neo-grillismo, è la Costituzione. 
Loro sono esistiti solo perché ci sono persone come lei: analfabeti funzionali.
Ma anche lei deve votare.

@kkvignarca @tomasomontanari Perché come il nonno “manderebbe a morire persone”?
Che poi, il nonno lo ha fatto?
Parliamo dell’albero genealogico di alcuni siciliani diventati simboli per molti?

@kkvignarca @tomasomontanari Lei ha anche capito perché ho usato il termine “razzismo”. 
Giudicare pregiudizialmente male una persona, per la sua razza, la sua pelle, la sua nazionalità, i suoi genitori, la sua cultura, le sue idee etc.
Il substrato mentale è lo stesso.

